import React from 'react'
import MainMenu from './components/Menu.js'
import VideoPlayer from './components/VideoPlayer.js'


function App() {
  return (
          <div className = 'App'>
            <MainMenu></MainMenu>
            <VideoPlayer 
                src='https://media.w3.org/2010/05/sintel/trailer_hd.mp4' 
                width ='600' 
                height = '480'
                fluid = {false} 
                autoPlay = {true}>
            </VideoPlayer>
          </div>
        );
}

export default App;
